import React from 'react';
import { Redirect, Route, Switch } from 'react-router-dom';

export const PrivateRoute = ({ component: Component, authed, ...rest }) => {
  return (
    <Route
      {...rest}
      render={props =>
        !!JSON.parse(localStorage.getItem('userData')) ? (
          <Component {...props} />
        ) : (
          <Redirect
            to={{
              pathname: '/',
              state: { from: props.location }
            }}
          />
        )
      }
    />
  );
};
